import React from 'react';
import { Typography, Grid, Link } from '@material-ui/core';
import MailIcon from '@material-ui/icons/Mail';
import LinkedInIcon from '@material-ui/icons/LinkedIn';

const Footer = () => {
    return (
        <Grid container
            direction="row"
            justify="center"
            alignItems="center"
            style={{ height: '100px', backgroundColor: 'rgba(0,0,0,0.7)' }}>

            <Grid item xs={12}>
                <Typography
                    display="block"
                    justifyContent="center"
                    align="center"
                    style={{ color: 'white' }}>
                    <MailIcon style={{ color: 'white', paddingRight: '3px' }} />
                    <a href='https://github.com'><LinkedInIcon style={{ color: 'white', paddingRight: '3px' }} /></a>

                </Typography>
            </Grid>

        </Grid>

    )
}

export default Footer;
